import "./App.css";
import CardForm from "./Components/CardForm";
import "bootstrap/dist/css/bootstrap.min.css";
import React, { useEffect } from "react";

function App() {
  useEffect(() => {
    document.title = "My Page Title";
  }, []);
  return (
    <div className="App">
      <CardForm />
    </div>
  );
}

export default App;
